    private function list_to_tree($data, $parent_id = '0', $pid = "0")
    {
        $list = array();

        foreach ($data as $key => $value) {
            $record = json_decode(json_encode($value), TRUE);
            if ($record['parentId'] == $parent_id) {
                $this->id = $this->id + 1;
                $temp = array(
                    "id" => $this->id,
                    "parent_id" => $pid,
                    "name" => $record['catName'],
                    "pinyin" => $record['pinyin'],
                    "spinyin" => $record['spinyin'],
                    "full_name" => $record['fullPathName'],
                );
                unset($data[$key]);
                $children = $this->list_to_tree($data, $record['catId'], $this->id);
                if (count($children)) {
                    $temp['children'] = $children;
                }
                $list[] = $temp;
            }
        }

        return $list;

    }

    public function tree_to_list($data)
    {
        $list = array();
        foreach ($data as $key => $value) {
            $temp = $value;
            unset($temp['children']);
            array_push($list, $temp);
            if (isset($value['children']) && count($value['children'])) {
                $children = $this->tree_to_list($value['children']);
                if (count($children)) {
                    $list = array_merge($list, $children);
                }
            }
        }
        return $list;
    }

